import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-permicao',
  templateUrl: './permicao.page.html',
  styleUrls: ['./permicao.page.scss'],
})
export class PermicaoPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}


<ion-content [fullscreen]="true">
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back" routerLink="/welcome"></ion-icon>
      <div id="logo">
        <img src="assets/icon/logoone.png" alt="" />
      </div>
      <div></div>
    </div>
  </div>



</ion-content>
